export default class extends React.Component {
    render() {
        return (
            <>
                <div className="footer">
                    <p>Footer</p>
                </div>
                <style jsx>{`
            .footer {
                position: fixed;
                left: 0;
                bottom: 0;
                width: 100%;
                height: 17%;
                background: #2f353a;
                color: white;
                text-align: center;
                border: 1px solid gray;
             }
        `}</style>
            </>
        );
    }
}
